import React from "react";
import "./App.css";
import Routers from "./Routes/Router";
import { BrowserRouter, Route, Routes } from "react-router-dom";

function App() {
  return (
    <>
      <BrowserRouter>
      <Routes>
        <Route></Route>
      </Routes>
      </BrowserRouter>
    </>
  );
}

export default App;
